INSERT INTO `WhyHostInfoBlock` VALUES (1,'Host Banner Title 1','hostBannerTitle1','Tro thanh chu nha','2020-04-13 11:33:10','2022-09-06 08:40:06'),(2,'Host Banner Image 1','hostBannerImage1','c6c8f7cc7f5bd4490b36acaea5e0f8e5.png','2020-04-13 11:33:10','2022-09-06 08:40:06'),(3,'Why Block Title 1','whyBlockTitle1','Who is Host? ','2020-04-13 11:33:10','2022-08-22 02:00:45'),(4,'Why Block Title 2','whyBlockTitle2','The host user can perform:','2020-04-13 11:33:10','2022-08-22 02:00:45'),(5,'Why Block Content 1','whyBlockContent1','The host is the user who is looking for a reliable platform to earn by renting his properties such as House, Apartment, Bed and Breakfast and house with garden etc to various types of guests. Host is one of  the key users in generating revenue in the platform.','2020-04-13 11:33:10','2022-08-22 02:00:45'),(6,'Why Block Content 2','whyBlockContent2','- List his property.\n- Manage the listings.\n- Add payot information.\n- View and export transaction history.','2020-04-13 11:33:10','2022-08-22 02:00:45'),(7,'Hosting Block Title Heading','hostingBlockTitleHeading','How to become a Host','2020-04-13 11:33:10','2022-08-22 02:01:36'),(8,'Hosting Block Title 1','hostingBlockTitle1','Asks your Place','2020-04-13 11:33:10','2022-08-22 02:01:36'),(9,'Hosting Block Title 2','hostingBlockTitle2','Set the Scene','2020-04-13 11:33:10','2022-08-22 02:01:36'),(10,'Hosting Block Title 3','hostingBlockTitle3','Get Ready for Guests','2020-04-13 11:33:10','2022-08-22 02:01:36'),(11,'Hosting Block Content 1','hostingBlockContent1','Beds, Bathrooms, Location, Amenities and more.\n','2020-04-13 11:33:10','2022-08-22 02:01:36'),(12,'Hosting Block Content 2','hostingBlockContent2','Photos, Cover Photo, Short description and Title.\n\n','2020-04-13 11:33:10','2022-08-22 02:01:36'),(13,'Hosting Block Content 3','hostingBlockContent3','Booking Setting, Calendar, Price, etc.\n\n\n','2020-04-13 11:33:10','2022-08-22 02:01:36'),(14,'Cover Section Title 1','coverSectionTitle1','Features in RentAll','2020-04-13 11:33:10','2022-08-31 02:40:16'),(15,'Cover Section Image 1','coverSectionImage1','29be9eee88d97f69b003ac37905dcdcc.jpeg','2020-04-13 11:33:10','2022-08-31 02:40:16'),(16,'Cover Section Content 1','coverSectionContent1','To become a Host and start your rental experience, you need to add your property information on the platform.','2020-04-13 11:33:10','2022-08-31 02:40:16'),(17,'Cover Section Content 2','coverSectionContent2','Click the \"Add New Listings\" option found on the lefr side of the screen to enter all your information. It is a three-step process to add al the details.\n\n','2020-04-13 11:33:10','2022-08-31 02:40:16'),(18,'Cover Section Feature 1','coverSectionFeature1','Booking options: Guests can choose either Request to Book or Instant Booking options based on the preferences set up by the host. ','2020-04-13 11:33:10','2022-08-31 02:40:16'),(19,'Cover Section Feature 2','coverSectionFeature2','Mint NFTs: Mint NFTs for each booking, ensuring transparency and security. Easy to exchange, buy and sell.','2020-04-13 11:33:10','2022-08-31 02:40:16'),(20,'Cover Section Feature 3','coverSectionFeature3','Map and Location - Based Search: The map will show the property list which is available on that particular location. It helps the users to simply identify the property from the map. ','2020-04-13 11:33:10','2022-08-31 02:40:16'),(21,'Cover Section Feature 4','coverSectionFeature4','Multi - Language and Multi - Currency: People from anywhere in the globe can book their stay using RentAll. This vacation rental script supports multi-language and multi-currency features to provide a hassle - free booking experience.','2020-04-13 11:33:10','2022-08-31 02:40:16'),(22,'Cover Section Feature 5','coverSectionFeature5','Multi Payment method: OneFin, Stripe Connect, PayPal or Paylater.  ','2020-04-13 11:33:10','2022-08-31 02:40:16'),(23,'Cover Section Feature 6','coverSectionFeature6','Multiple homepage layouts: RentAll assists with multiple landing page formats like a detailed search bar, image slider and banner content.','2020-04-13 11:33:10','2022-08-31 02:40:16'),(24,'Payment Title Heading','paymentTitleHeading','It to make a type specimen book','2020-04-13 11:33:10','2020-04-13 12:17:56'),(25,'Payment Title 1','paymentTitle1','Sed ut perspiciatis','2020-04-13 11:33:10','2020-04-13 12:17:56'),(26,'Payment Title 2','paymentTitle2','Nemo enim ipsam','2020-04-13 11:33:10','2020-04-13 12:17:57'),(27,'Payment Title 3','paymentTitle3','Neque porro','2020-04-13 11:33:10','2020-04-13 12:17:57'),(28,'Payment Content 1','paymentContent1','Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur\n\n','2020-04-13 11:33:10','2020-04-13 12:17:57'),(29,'Payment Content 2','paymentContent2','Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt\n\n','2020-04-13 11:33:10','2020-04-13 12:17:57'),(30,'Payment Content 3','paymentContent3','Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum\n\n','2020-04-13 11:33:10','2020-04-13 12:17:57'),(31,'Quote Section Title 1','quoteSectionTitle1','NFT  Promising Pioneering Technology Trend','2020-04-13 11:33:10','2022-08-22 02:04:19'),(32,'Quote Section Title 2','quoteSectionTitle2','NFT Rentals: The Next Step in Play-To-Earn Games','2020-04-13 11:33:10','2022-08-22 02:04:19'),(33,'Quote Section Content 1','quoteSectionContent1','In recent times, the NFT has attracted many big companies in the fields of technology, entertainment, and fashion to race the NFT market. They believe that NFT will be a product of the new technology age and is predicted to create a fever in the near future. So what is NFT? How beneficial is it that the big companies have to follow such trends?','2020-04-13 11:33:10','2022-08-22 02:04:19'),(34,'Quote Section Content 2','quoteSectionContent2','Some NFTs come with exclusive benefits, and reNFT enables owners to monetize those benefits without selling their NFTs, kind of like the blockchains version of Airbnb.\n','2020-04-13 11:33:10','2022-08-22 02:04:19'),(35,'Quote Section Image 1','quoteSectionImage1','3fcdb5604b903614e0f0298fd279384c.jpeg','2020-04-13 11:33:10','2022-08-22 02:04:19'),(36,'Quote Section Image 2','quoteSectionImage2','dbeaa2d246733b6f6080d76ef36345b2.jpeg','2020-04-13 11:33:10','2022-08-22 02:04:19'),(37,'Quote Section Button 1','quoteSectionButton1','Read more','2020-04-13 11:33:10','2022-08-22 02:04:19'),(38,'Quote Section Button 2','quoteSectionButton2','Read more','2020-04-13 11:33:10','2022-08-22 02:04:19'),(39,'FAQ Title 1','faqTitle1','What is Rentall for Hosts?','2020-04-13 11:33:10','2022-08-22 02:05:01'),(40,'FAQ Title 2','faqTitle2','How does RentAll protect my guest? ','2020-04-13 11:33:10','2022-08-22 02:05:01'),(41,'FAQ Title 3','faqTitle3','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(42,'FAQ Title 4','faqTitle4','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(43,'FAQ Title 5','faqTitle5','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(44,'FAQ Title 6','faqTitle6','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(45,'FAQ Title 7','faqTitle7','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(46,'FAQ Title 8','faqTitle8','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(47,'FAQ Content 1','faqContent1','RentAll is a rental marketplace solution that is customizable to any sharing economy business ideas. It allows entrepreneurs to quickly start their rental business. It has all the necessary features ti build your online rentall business.\n','2020-04-13 11:33:10','2022-08-22 02:05:01'),(48,'FAQ Content 2','faqContent2','Both Host and Guest can report each other on the platform. To report a user, they can go to inbox section find the user from the Travelling and Hosting. \nEach listing and reservation on the site will clearly state the RentAll cancellation policy. Guests can cancel their reservation by clicking the \'Cancel\' button on the upcoming reservation section.\n\n','2020-04-13 11:33:10','2022-08-22 02:05:01'),(49,'FAQ Content 3','faqContent3','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(50,'FAQ Content 4','faqContent4','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(51,'FAQ Content 5','faqContent5','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(52,'FAQ Content 6','faqContent6','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(53,'FAQ Content 7','faqContent7','','2020-04-13 11:33:10','2022-08-22 02:05:01'),(54,'FAQ Content 8','faqContent8','','2020-04-13 11:33:10','2022-08-22 02:05:01');
